import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Home from './pages/Home';
import Login from './pages/Login/Login';
import Signup from "./pages/Signup/Signup";
import UserDashboard from "./pages/UserDashboard/UserDashboard";
import Wishlist from "./pages/Wishlist/Wishlist";
import Gold from './pages/Bullions/Gold';
import Silver from './pages/Bullions/Silver';
import Platinum from './pages/Bullions/Platinum';
import { UserProvider } from './context/UserContext';
import './App.css';
import ProductDetail from './pages/ProductDetail/ProductDetail'; // Import ProductDetail

const App: React.FC = () => {
    return (
        <UserProvider>
            <Router>
                <div className="app">
                    <Header />
                    <main>
                        <Routes>
                            <Route path="/" element={<Home />} />
                            <Route path="/login" element={<Login />} />
                            <Route path="/signup" element={<Signup />} />
                            <Route path="/user" element={<UserDashboard />} />
                            <Route path="/wishlist" element={<Wishlist />} />
                            <Route path="/guides/gold" element={<Gold />} />
                            <Route path="/guides/silver" element={<Silver />} />
                            <Route path="/guides/platinum" element={<Platinum />} />
                        </Routes>
                    </main>
                    <Footer />
                </div>
            </Router>
        </UserProvider>
    );
};

export default App;
